import React from 'react';
import '../../App.js';
import Cards from '../Cards.js';
import Footer from '../Footer.js';
import Main from '../Main.js';

function Signup(){
    return(
        <>
            <Main/>
            <h2>SIGN UP</h2>
            <Cards/>
            <Footer />
        </>
    )
}

export default Signup;
